import React from "react";
import styled from "styled-components";
const Nav = styled.nav`
    display: flex;
    flex-direction: row;
    width: 600px;
    color: #bc5a5a;
    list-style: none;
    font-size: 1.4rem;
    * {
        margin: 0 20px;
    }
`;
const Menu = () => {
    return (
        <Nav>
            <li>home</li>
            <li>Cotnact</li>
        </Nav>
    );
};

export default Menu;
